import React, {useContext} from 'react';
import {observer} from "mobx-react-lite";
import {Context} from "../index";
import {Card} from "react-bootstrap";

const NameBar = observer(() => {
    const {car} = useContext(Context)
    return (
        <div>
            {/*{car.names.map(name =>*/}
            {/*<Card*/}
            {/*    key={name.id}*/}
            {/*>*/}
                {car.name}
            {/*</Card>*/}
            {/*)}*/}
        </div>
    );
})
export default NameBar;
